import React, { useState } from "react";

const SearchedUserProfile = () => {
  const [isFollowing, setIsFollowing] = useState(false);

  const handleFollow = () => {
    setIsFollowing(!isFollowing);
  };

  return (
    <div className="min-h-screen sm:pl-72 sm:pt-24 max-w-8xl mx-auto p-6 bg-gray-50">
      {/* User Overview */}
      <div className="flex items-center space-x-4 p-4 bg-white shadow rounded-lg">
        <img
          src="https://via.placeholder.com/150"
          alt="Profile"
          className="w-20 h-20 rounded-full object-cover"
        />
        <div>
          <h2 className="text-xl font-bold text-black">John Doe</h2>
          <p className="text-gray-600">Software Developer | Tech Enthusiast</p>
          <button
            className={`mt-2 px-4 py-2 rounded-lg text-white ${
              isFollowing ? "bg-red-500" : "bg-blue-500"
            }`}
            onClick={handleFollow}
          >
            {isFollowing ? "Unfollow" : "Follow"}
          </button>
        </div>
      </div>

      {/* Mutual Connections */}
      <div className="mt-6 bg-white shadow rounded-lg p-4">
        <h3 className="text-lg font-bold mb-4 text-black">
          Mutual Connections
        </h3>
        <div className="flex space-x-4">
          {Array(3)
            .fill("")
            .map((_, index) => (
              <div key={index} className="flex flex-col items-center">
                <img
                  src={`https://via.placeholder.com/100?text=User+${index + 1}`}
                  alt={`User ${index + 1}`}
                  className="w-16 h-16 rounded-full object-cover"
                />
                <span className="text-gray-700 mt-2">User {index + 1}</span>
              </div>
            ))}
        </div>
      </div>

      {/* Posts */}
      <div className="mt-6 bg-white shadow rounded-lg p-4">
        <h3 className="text-lg font-bold mb-4 text-black">Posts</h3>
        <div className="grid grid-cols-2 sm:grid-cols-3 gap-4">
          {Array(6)
            .fill("")
            .map((_, index) => (
              <div
                key={index}
                className="bg-gray-200 rounded-lg overflow-hidden"
              >
                <img
                  src={`https://via.placeholder.com/150?text=Post+${index + 1}`}
                  alt={`Post ${index + 1}`}
                  className="w-full h-40 object-cover"
                />
              </div>
            ))}
        </div>
      </div>

      {/* Media */}
      <div className="bg-white shadow rounded-lg p-4 mt-6">
        <h3 className="text-lg font-bold mb-4 text-black">Media</h3>
        <div className="grid grid-cols-2 sm:grid-cols-3 gap-4">
          {Array(4)
            .fill("")
            .map((_, index) => (
              <div
                key={index}
                className="bg-gray-200 rounded-lg overflow-hidden"
              >
                <img
                  src={`https://via.placeholder.com/150?text=Media+${
                    index + 1
                  }`}
                  alt={`Media ${index + 1}`}
                  className="w-full h-40 object-cover"
                />
              </div>
            ))}
        </div>
      </div>

      {/* Followers and Following */}
      <div className="mt-6 bg-white shadow rounded-lg p-4 flex justify-between">
        <div>
          <h4 className="text-lg font-bold">Followers</h4>
          <p className="text-gray-700">234</p>
        </div>
        <div>
          <h4 className="text-lg font-bold">Following</h4>
          <p className="text-gray-700">180</p>
        </div>
      </div>
    </div>
  );
};

export default SearchedUserProfile;
